import React from 'react';
import './App.css'
const Cardcss={backgroundColor:"#D7D9CE",
        width:"max-content",
      
  }
const btnCss={color:"#B3001B",
  fontSize:"18px",
  fontWeight:"800",
  padding:'3px',
  marginLeft:'10%',
  borderRadius:'10px',
  outline:'none',
  cursor:'pointer'
}
function Cards(props){
  return(
    <>
      <div className="Card" style={Cardcss}>
        <img src={props.src}
          width="200px" height="200px"
        />
        <div className="CardInfo" >
          <div className="title" style={{color:"white",
          fontWeight:"800",fontFamily:"sans-serif"}}><h2>{props.title}</h2></div>
          <button style={btnCss}>Watch NOW</button>
        </div>
      </div>
    </>
  )
}
export default Cards;
